            "textDisplay": "Will the Messiah really eliminate all evil?\u003cbr\u003e′′ You loved justice and you hate wickedness. Therefore God, your God, has anointed you with oil of celebration more than your companions ′′ (Psalm 45:7 [45:8, BE])\u003cbr\u003eThose who rule have the responsibility to uphold the law. The Messiah, as King of God&#39;s government, will undoubtedly act in this respect. ′′ A little longer, and the wicked shall no longer be; and you shall certainly pay attention to his place, and he shall not be. But the tame selves will possess the earth, and in reality they will try exquisite delight in the abundance of peace ′′ (Psalm 37:10, 11).\u003cbr\u003eWhat kind of change can we expect?\u003cbr\u003eGod will fully fulfill his promise to create ′′ new heavens &quot;, a just government that will administer a ′′ new land ′′ (Isaiah 65:17). The Messiah government will give blessings not only to the land of Israelbut to ′′ all nations &quot;, just as Jehovah promised Abraham (Isaiah 2:2, 3; Genesis 22:18). The Kingdom of God governed by the Messiah will provide a definitive and universal answer to the challenge thrown to the name and in God&#39;s purpose.\u003cbr\u003eWhat do you mean life then will be different from the current one?\u003cbr\u003eHuman race will see the long awaited fulfillment of God&#39;s promise through Isaiah: ′′ He will certainly make judgement between the nations and make things right compared to many peoples. And they&#39;ll have to make their swords plow swords and spears to prun. Nation will not raise the sword against nation, nor will they learn the war anymore &quot;. The prophecy continues: ′′ They will not damage nor cause ruin throughout my holy mountain; for the earth will certainly be filled with Jehovah&#39;s knowledge as the waters cover the same sea ′′ (Isaiah 2:4; 11:9).\u003cbr\u003eHow do we know this will become reality?\u003cbr\u003eThese promises are part of the unchanging purpose of the Almighty God, Jeho