            "textOriginal": "Will the Messiah really eliminate all evil?\n′′ You loved justice and you hate wickedness. Therefore God, your God, has anointed you with oil of celebration more than your companions ′′ (Psalm 45:7 [45:8, BE])\nThose who rule have the responsibility to uphold the law. The Messiah, as King of God's government, will undoubtedly act in this respect. ′′ A little longer, and the wicked shall no longer be; and you shall certainly pay attention to his place, and he shall not be. But the tame selves will possess the earth, and in reality they will try exquisite delight in the abundance of peace ′′ (Psalm 37:10, 11).\nWhat kind of change can we expect?\nGod will fully fulfill his promise to create ′′ new heavens \", a just government that will administer a ′′ new land ′′ (Isaiah 65:17). The Messiah government will give blessings not only to the land of Israelbut to ′′ all nations \", just as Jehovah promised Abraham (Isaiah 2:2, 3; Genesis 22:18). The Kingdom of God governed by the Messiah will provide a definitive and universal answer to the challenge thrown to the name and in God's purpose.\nWhat do you mean life then will be different from the current one?\nHuman race will see the long awaited fulfillment of God's promise through Isaiah: ′′ He will certainly make judgement between the nations and make things right compared to many peoples. And they'll have to make their swords plow swords and spears to prun. Nation will not raise the sword against nation, nor will they learn the war anymore \". The prophecy continues: ′′ They will not damage nor cause ruin throughout my holy mountain; for the earth will certainly be filled with Jehovah's knowledge as the waters cover the same sea ′′ (Isaiah 2:4; 11:9).\nHow do we know this will become reality?\nThese promises are part of the unchanging purpose of the Almighty God, Jehovah, who is God ′′ in the heavens above and on the earth below ′′ (Joshua 2:11). Jehovah himself tells us: ′′ Remember the first things of a long time ago, that I I am the Divine and there is no other God, nor any like me; He who announces the term from the beginning, and from a long time ago the things that have not been done; He who says: ' My own counsel will take effect, and I will do whatever is my delight ' ′′ (Isaiah 46:9, 10). Jehovah said he will fulfill his purpose through the Messiah. Who on earth could stop him? If you would like more information visit the official website of Jehovah’s Witnesses at www.jw.org",
